import React from 'react';
import {
  Container,
  Card,
  CardContent,
  Typography,
  Box
} from '@mui/material';

const PreguntasTeoricas = () => {
  return (
    <Container
      maxWidth={false}
      disableGutters
      sx={{
        minHeight: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        px: 2,
        py: 4,
        position: 'relative'
      }}
    >
      <Card
        sx={{
          width: {
            xs: 300,
            sm: 500,
            md: 600,
          },
          borderRadius: "20px",
          backgroundColor: "rgba(255, 255, 255, 0.3)",
          backdropFilter: "blur(8px)",
          WebkitBackdropFilter: "blur(8px)",
          boxShadow: `
            6px 6px 12px rgba(0,0,0,0.1),
            -6px -6px 12px rgba(255,255,255,0.4)
          `,
          color: "#333",
          textAlign: 'left',
        }}
      >
        <CardContent>
          <Typography variant="h5" fontWeight="bold" gutterBottom>
            Preguntas de la Prueba Teórica
          </Typography>
          <Typography variant="body1">
            Aquí puedes colocar las preguntas y respuestas de tu prueba técnica.
          </Typography>
        </CardContent>
      </Card>
    </Container>
  );
};

export default PreguntasTeoricas;
